selectedNodes:
    IF: 用户需要帮助;用户回复1
    flow:
    graph TB
r_01(["userRequest:实验室导览"])
d_01["detectHuman"]
c_01{"condition:检测到人;人员检测结果"}
s_01["speak:欢迎来到CDI实验室，请问您想参观哪里呢？"]
a_01["ask:询问用户是否需要帮助;用户回复1"]
c_02{"condition:用户需要帮助;用户回复1"}
a_02["ask:询问用户想参观的地方;用户回复2"]
g_01["goto:用户回复2"]
s_02["speak:告知用户当前位置;用户回复2"]
s_03["speak:附近没有客户"]
g_02["goto:充电桩"]
s_04["speak:任务完成，返回充电桩"]
k_01(["end:服务结束"])
r_01 --> d_01
d_01 --> c_01
c_01 --true--> s_01
s_01 --> a_01
a_01 --> c_02
c_02 --true--> a_02
a_02 --> g_01
g_01 --> s_02
s_02 --> g_02
c_02 --false--> g_02
c_01 --false--> s_03
s_03 --> g_02
g_02 --> s_04
s_04 --> k_01

